import './App.css';
import './styles.css';
import Navbar from './Navbar';
import About from './Pages/About';
import Pricing from './Pages/Pricing';

function App() {
  let component;

  switch (window.location.pathname) {
    case "/":
      component = <App/>;
      break;
    case "/pricing":
      component = <Pricing/>;
      break;
    case "/pricing":
      component = <About/>;
      break;
  }

  return (
    <>
      <Navbar></Navbar>
      {component}
    </>
  );
}

export default App;
